            {stringSet.CHANNEL_SETTING__PROFILE__EDIT}
          </Label>
        </TextButton>
        {
          showModal && (
            <EditDetailsModal
              onCancel={() => setShowModal(false)}
              onSubmit={onChannelInfoChange}
              channel={channel}
              theme={theme}
            />
          )
        }
      </div>
    </div>
  );
}

import React, {
  ReactElement,
  useEffect,
  useState,
  useContext,
} from 'react';

import Modal from '../../../ui/Modal';
import UserListItem from '../../../ui/UserListItem';
import { LocalizationContext } from '../../../lib/LocalizationContext';
import { noop } from '../../../utils/utils';

interface Props {
  currentUser: string;
  hideModal(): void;
  channel: SendBird.OpenChannel;
}

export default function ParticipantsModal({
  hideModal,
  channel,
}: Props): ReactElement {
  const { stringSet } = useContext(LocalizationContext);
  const [participants, setParticipants] = useState<Array<SendBird.User>|null>([]);
  const [participantListQuery, setParticipantListQuery] = useState<SendBird.ParticipantListQuery | null>(null);
  useEffect(() => {
    if (!channel || !channel.createParticipantListQuery) {
      return;
    }
    const participantListQuery = channel.createParticipantListQuery();
    setParticipantListQuery(participantListQuery);
    participantListQuery.next((participantList, error) => {
      if (error) {
        return;
      }
      setParticipants(participantList);
    });
  }, []);
  return (
    <div>
      <Modal
        hideFooter
        onCancel={() => hideModal()}
        onSubmit={noop}
        titleText={stringSet.OPEN_CHANNEL_SETTINGS__ALL_PARTICIPANTS_TITLE}
      >
        <div
          className="sendbird-more-members__popup-scroll"
          onScroll={(e) => {
            const { hasNext } = participantListQuery;
            const target = e.target as HTMLTextAreaElement;
            const fetchMore = (
              target.clientHeight + target.scrollTop === target.scrollHeight
            );

            if (hasNext && fetchMore) {
              participantListQuery.next((fetchedParticipants, error) => {
                if (error) {
                  return;
                }
                setParticipants([
                  ...participants,
                  ...fetchedParticipants,
                ])
              });
            }
          }}
        >
          { participants.map((p) => (
            <UserListItem
              user={p}
              key={p.userId}
            />
          ))}
        </div>
      </Modal>
    </div>
  )
}

import React, {
  ReactElement,
  useContext,
  useEffect,
  useRef,
  useState,
} from 'react'
import { LocalizationContext } from '../../../lib/LocalizationContext';

import { UserProfileContext } from '../../../lib/UserProfileContext';
import Button from '../../../ui/Button';
import {
  Type as ButtonTypes,
  Size as ButtonSizes,
} from '../../../ui/Button/type';
import Accordion from '../../../ui/Accordion';
import Icon, { IconTypes, IconColors } from '../../../ui/Icon';
import Avatar from '../../../ui/Avatar/index';
import Label, { LabelTypography, LabelColors } from '../../../ui/Label';
import ParticipantsModal from './ParticipantsModal';
import UserProfile from '../../../ui/UserProfile';
import ContextMenu, { MenuItems } from '../../../ui/ContextMenu';

const SHOWN_MEMBER_MAX = 10;

interface UserListItemProps {
  member: SendBird.User;
  currentUser?: string;
}

export const UserListItem = ({
  member,
  currentUser = '',
}: UserListItemProps): ReactElement => {
  const avatarRef = useRef(null);
  const {
    disableUserProfile,
    renderUserProfile,
  } = useContext(UserProfileContext);
  const { stringSet } = useContext(LocalizationContext);
  return (
    <div className="sendbird-participants-accordion__member">
      <div className="sendbird-participants-accordion__member-avatar">
        <ContextMenu
          menuTrigger={(toggleDropdown) => (
            <Avatar
              onClick={() => {
                if (!disableUserProfile) {
                  toggleDropdown();
                }
              }}
              ref={avatarRef}
              src={member.profileUrl}
              width={24}
              height={24}
            />
          )}
          menuItems={(closeDropdown) => (
            <MenuItems
              openLeft
              parentRef={avatarRef}
              // for catching location(x, y) of MenuItems
              parentContainRef={avatarRef}
              // for toggling more options(menus & reactions)
              closeDropdown={closeDropdown}
              style={{ paddingTop: 0, paddingBottom: 0 }}
            >
              {
                renderUserProfile
                  ? renderUserProfile({
                    user: member,
                    currentUserId: currentUser,
                    close: closeDropdown,
                  })
                  : (
                    <UserProfile
                      disableMessaging
                      user={member}
                      currentUserId={currentUser}
                      onSuccess={closeDropdown}
                    />
                  )
              }
            </MenuItems>
          )}
        />
      </div>
      <Label type={LabelTypography.SUBTITLE_2} color={LabelColors.ONBACKGROUND_1}>
        {member.nickname || stringSet.NO_NAME}
        {
          (currentUser === member.userId) && (
            stringSet.YOU
          )
        }
      </Label>
    </div>
  );
};

interface Props {
  channel: SendBird.OpenChannel;
  currentUser: string;
}

export default function ParticipantsAccordion({ channel, currentUser }: Props): ReactElement {
  const [participants, setParticipants] = useState([]);
  const [showMoreModal, setShowMoreModal] = useState(false);
  const { stringSet } = useContext(LocalizationContext);

  useEffect(() => {
    if (!channel || !channel.createParticipantListQuery) {
      return;
    }
    const participantListQuery = channel.createParticipantListQuery();
    participantListQuery.next((participantList, error) => {
      if (error) {
        return;
      }
      setParticipants(participantList);
    });
  }, [channel]);

  return (
    <Accordion
      className="sendbird-participants-accordion"
      id="participants"
      renderTitle={() => (
        <>
          <Icon
            type={IconTypes.MEMBERS}
            fillColor={IconColors.PRIMARY}
            width={24}
            height={24}
            className="sendbird-openchannel-settings__accordion-icon"
          />
          <Label
            type={LabelTypography.SUBTITLE_1}
            color={LabelColors.ONBACKGROUND_1}
          >
            {stringSet.OPEN_CHANNEL_SETTINGS__PARTICIPANTS_ACCORDION_TITLE}
          </Label>
        </>
      )}
      renderContent={() => (
        <div className="">
          <div className="sendbird-participants-accordion__list">
            {
              participants.slice(0, SHOWN_MEMBER_MAX).map((p) => (
                <UserListItem
                  member={p}
                  currentUser={currentUser}
                  key={p.userId}
                />
              ))
            }
            {
              (participants && participants.length === 0)
                ? (
                    <Label
                      className="sendbird-channel-settings__empty-list"
                      type={LabelTypography.SUBTITLE_2}
                      color={LabelColors.ONBACKGROUND_3}
                    >
                      {stringSet.OPEN_CHANNEL_SETTINGS__EMPTY_LIST}
                    </Label>
                ): null
            }
          </div>
          {
            participants.length >= SHOWN_MEMBER_MAX && (
              <div className="sendbird-participants-accordion__footer">
                <Button
                  className="sendbird-participants-accordion__footer__all-participants"
                  type={ButtonTypes.SECONDARY}
                  size={ButtonSizes.SMALL}
                  onClick={() => setShowMoreModal(true)}
                >
                  {stringSet.OPEN_CHANNEL_SETTINGS__SEE_ALL}
                </Button>
                {
                  showMoreModal && (
                    <ParticipantsModal
                      currentUser={currentUser}
                      hideModal={() => {
                        setShowMoreModal(false);
                      }}
                      channel={channel}
                    />
                  )
                }
              </div>
            )
          }
        </div>
      )}
    />
  );
}

